INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<h2><a href="/about-us">About Us</a></h2>\r\n<a href="/about-us">We are a national foodservice company delivering specialist and general food ingredients from around the world to restaurants, hotels, catering facilities and food manufacturers.  Established 25 years ago, family run, we pride ourselves with exceptional service and commitment to customer requirements.</a>', 'About Us Homepage Block', 'full_html'),
(2, '<h2><a href="../products">Products</a></h2>\r\n<a href="../products">Over 3,500 dry, chilled and frozen food ingredients are available for you to order. Whether it is simply cooking oil or very exquisite French ingredients or fine Oriental noodles or Chipotle Chillies from Mexico, we are here to satisfy.</a>', 'Products Block on homepage', 'full_html'),
(3, '<h2><a href="../faq-page">Services</a></h2>\r\n<a href="../faq-page">Whether it''s dedicated account management, product sourcing, technical information, or order tracking, we provide a whole package of services. </a>', 'Service Homepage Block', 'full_html'),
(4, '<h2><a href="../content/our-fleet">Transport</a></h2>\r\n<a href="../content/our-fleet">Located just west of the M25, we can deliver to you six days per week in London. Operating from a 35,000 square foot warehouse with 45 multi-temperature vehicles, we have the flexibility and capacity to meet your requirements. Click on Transport to view a map showing our distribution coverage around London and nationally.</a>', 'Logistics Homepage Block', 'full_html'),
(5, 'Penta Foods Lorry', 'Top pic on homepage', 'full_html'),
(6, '<p>Middle pic goes here</p>', 'middle Pic on homepage', 'filtered_html'),
(7, '<h2><a href="#">Our Brands</a></h2>', 'Our Brands Hompeage Block', 'popup_tags'),
(8, '<h2><a href="../content/olympics">NOTICE BOARD </a></h2>\r\n\r\n* Please note that we are now delivering on SATURDAYS within the M25</a></p>\r\n* OUTSIDE the M25 SATURDAY delivery must be on request</a></p>\r\n* Please enquire about our cheese selection range on offer</a></p>\r\n\r\n\r\n', 'Notice Board Homepage Block', 'full_html'),
(9, '<p>Bottom Pic</p>', 'Bottom Pic Homepage Block', 'filtered_html'),
(10, 'orders@pentafoods.com\r\n0845 051 0223', 'Header Contact Details', 'filtered_html'),
(11, '<div id="contact-left"><p><strong>To place an order:</strong></p></div>\r\n<div id="contact-right"><p id="contact-email">orders@pentafoods.com</p><p id="contact-phone">0845 051 0223</p></div>\r\n', 'Call us today', 'full_html'),
(12, '<a href="http://pentafoods.com/content/contact-us">Contact Us</a> | <a href="/terms.pdf" target="_blank">Terms & Conditions</a> | <a href="/application_of_account.pdf" target="_blank">Account Applications</a> | &copy;2012 Penta Foods Ltd\r\n<span class="small">Penta Foods Ltd, Penta House, Lynchford Lane, Farnborough, Hampshire, GU14 6JD | Tel. 0845 051 0223 | Fax. 0845 051 0224 | <a href="mailto:sales@pentafoods.com">sales@pentafoods.com</a>', 'Footer', 'full_html'),
(13, '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent et arcu non arcu dapibus sodales. Aliquam erat volutpat. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Maecenas commodo dictum diam vitae porta. Vestibulum a tellus quis eros placerat porttitor. Curabitur urna leo, aliquam et dictum quis, iaculis id ante. Nam in orci sem. Nulla facilisi. Aenean feugiat mollis tincidunt. Duis bibendum tincidunt tortor sit amet rhoncus. In ultricies venenatis nisl, eu faucibus tellus consectetur non. Cras congue nibh hendrerit nisl scelerisque pharetra. Vestibulum aliquam purus vulputate dui interdum vel facilisis purus vulputate.</p>', 'about-us-story', 'filtered_html'),
(14, '<p>Image goes here</p>', 'About Us Image', 'filtered_html'),
(15, '<ul>\r\n<li>Come off Junction Number 4 on the M3</li>\r\n<li>Head south towards Farnborough/Aldershot on the A331</li>\r\n<li>Take 4th exit for North Camp</li>\r\n<li>At roundabout, take sharp left into Lynchford Lane.</li>\r\n</ul>\r\n<iframe width="340" height="540" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="http://maps.google.co.uk/maps?f=q&amp;source=s_q&amp;hl=en&amp;geocode=&amp;q=Penta+House,+Lynchford+Lane+Farnborough+Hants+GU14+6JF&amp;aq=&amp;sll=51.277434,-0.733681&amp;sspn=0.00698,0.009495&amp;ie=UTF8&amp;hq=Penta+House,&amp;hnear=Lynchford+Ln,+United+Kingdom&amp;ll=51.277434,-0.733681&amp;spn=0.006295,0.006295&amp;t=m&amp;output=embed"></iframe><br /><small><a href="http://maps.google.co.uk/maps?f=q&amp;source=embed&amp;hl=en&amp;geocode=&amp;q=Penta+House,+Lynchford+Lane+Farnborough+Hants+GU14+6JF&amp;aq=&amp;sll=51.277434,-0.733681&amp;sspn=0.00698,0.009495&amp;ie=UTF8&amp;hq=Penta+House,&amp;hnear=Lynchford+Ln,+United+Kingdom&amp;ll=51.277434,-0.733681&amp;spn=0.006295,0.006295&amp;t=m" style="color:#0000FF;text-align:left">View Larger Map</a></small>', 'Find us block', 'full_html'),
(16, '<h6>Key</h6>\r\n<table width="100%" border="0" id="key">\r\n      <tr>\r\n        <td width="33%"><b>M</b> = Monday</td>\r\n        <td width="34%"><b>T</b> = Tuesday</td>\r\n        <td width="33%"><b>W</b> = Wednesday</td>\r\n      </tr>\r\n      <tr>\r\n        <td width="33%"><b>Th</b> = Thursday</td>\r\n        <td width="34%"><b>F</b> = Friday</td>\r\n        <td width="33%"><b>M to F</b> = Monday to Friday</td>\r\n      </tr>\r\n      <tr>\r\n        <td colspan="3"><b>M to F Sun</b> = Monday to Friday Sunday</td>\r\n      </tr>\r\n</table>\r\n<table width="100%" border="0">\r\n        <tr>\r\n            <td class="c2" width="33%" height="30">\r\n                <div class="c1">\r\n                    Scotland\r\n                </div>\r\n            </td>\r\n\r\n            <td class="c3" width="33%">\r\n                <div class="c1">\r\n                    North East\r\n                </div>\r\n            </td>\r\n\r\n            <td class="c4" width="33%">\r\n                <div class="c1">\r\n                    North West\r\n                </div>\r\n            </td>\r\n        </tr>\r\n\r\n        <tr height="5px">\r\n            <td valign="top">\r\n            Glasgow - <strong>T F</strong>\r\n            Edinburgh - <strong>T F</strong>\r\n            Aberdeen - <strong>T F</strong></td>\r\n\r\n            <td valign="top">\r\n            Newcastle - <strong>M TH</strong></td>\r\n\r\n            <td valign="top">\r\n            Manchester - <strong>T F</strong>\r\n            Liverpool - <strong>T F</strong>\r\n            Oldham - <strong>T F</strong>\r\n            Chester - <strong>T F</strong>\r\n            Blackpool - <strong>T F</strong></td>\r\n        </tr>\r\n\r\n        <tr>\r\n            <td class="c5" height="30">\r\n                <div class="c1">\r\n                    Wales\r\n                </div>\r\n            </td>\r\n\r\n            <td class="c6">\r\n                <div class="c1">\r\n                    East En