       <td valign="top" class="td-outline">\r\n            Woking - <strong>M to F</strong>\r\n            Walton - <strong>T F</strong>\r\n            Weybridge - <strong>M to F</strong>\r\n            Marlow - <strong>T F</strong>\r\n            Reading - <strong>T F</strong>\r\n            Henley - <strong>T F</strong>\r\n            Windsor - <strong>T F</strong>\r\n            High Wycombe - <strong>T F</strong>\r\n            Canterbury - <strong>T F</strong>\r\n            Tunbridge Wells - <strong>T F</strong>\r\n            Sevenoak - <strong>T F</strong>\r\n            Lakeside - <strong>T F</strong>\r\n            Watford - <strong>M Th</strong>\r\n            Newbury - <strong>M Th</strong>\r\n            Egham - <strong>M to F</strong>\r\n            Ascot - <strong>M to F</strong></td>\r\n\r\n            <td valign="top">\r\n            London (Greater &amp; Central) <strong>- 6 days</strong>\r\n            Heathrow - <strong>M to F Sun</strong></td>\r\n        </tr>\r\n    </table>', 'table for the logistics infographic', 'full_html'),
(17, '<p>Every successful distribution business must operate a fully integrated warehouse. With real-time inventory control and picking/checking performance monitoring, we are able to accurately pick and load over 1000 orders daily. All products and deliveries are fully integrated to their assigned routes to ensure maximum delivery efficiency.</p>\r\n<p>We operate from our main depot in Farnborough, Hampshire, consisting of 35,000 square foot storage for ambient, chilled and frozen products serving London and Southern England. The Manchester depot consists of 10,000 square, serves the Midlands, North England and Scotland.</p>\r\n<p>The Warehouse operates 24 hours a day six days a week processing and delivering your orders. There are sixty members of the Warehouse management and picking team fully trained in food handling, health and safety.</p>', 'Warehousing', 'full_html'),
