('node', '2_column_page', 0, 16, 16, 'und', 0, '<p>We have been established for over 25 years delivering exquisite food ingredients to Chefs in London and around the UK.</p>\r\n<p>Whether you run a single restaurant or hotel in London or a large established chain or are in the foodservice industry, we have the global product range, sourcing reach and delivery resources to meet your requirements.</p>\r\n<p>Being a family business, our ethos and promise to you is:</p>\r\n<ul>\r\n<li>Total commitment to serve your foodservice requirements</li>\r\n<li>An unrivalled product range </li>\r\n<li>Flexible delivery solutions</li>\r\n<li>To promptly and clearly communicate with you </li>\r\n<li>Extensive resources available to us and with our personal approach resulting in a fulfilling customer experience</li>\r\n</ul>', '', 'full_html'),
('node', 'faq', 0, 17, 17, 'und', 0, '<p>Ut dignissim rhoncus augue et volutpat. Nunc eget turpis dui, vitae sollicitudin eros. Aenean lectus urna, lobortis vel commodo id, faucibus non lorem. Maecenas mollis mauris a magna venenatis lobortis. Aenean egestas leo ut dui varius bibendum. Sed eu arcu at risus dapibus mattis. Suspendisse potenti. Fusce non ultrices mi. Donec vitae nisl eu odio facilisis bibendum.</p>', '', 'full_html'),
('node', 'faq', 0, 18, 18, 'und', 0, '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean nec tristique tellus. Pellentesque ut nisi lorem. Sed eget diam mauris, id blandit orci. Aliquam augue dui, volutpat et egestas sed, faucibus sed erat. Etiam fringilla faucibus mi, ac ultrices nunc ornare ut. Etiam nunc eros, congue vel tincidunt et, molestie dignissim tortor. Suspendisse elementum condimentum felis vitae molestie. Cras sem metus, congue ac sagittis eu, fermentum eget libero. Quisque vehicula accumsan augue nec porttitor.</p><p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean nec tristique tellus. Pellentesque ut nisi lorem. Sed eget diam mauris, id blandit orci. Aliquam augue dui, volutpat et egestas sed, faucibus sed erat. Etiam fringilla faucibus mi, ac ultrices nunc ornare ut. Etiam nunc eros, congue vel tincidunt et, molestie dignissim tortor.</p><p>Suspendisse elementum condimentum felis vitae molestie. Cras sem metus, congue ac sagittis eu, fermentum eget libero. Quisque vehicula accumsan augue nec porttitor.</p>', '', 'full_html'),
('node', 'webform', 0, 20, 20, 'und', 0, '<div style="float:left; width:50%; height:250px;" ><strong>Head Office</strong> <br/><strong>Farnborough Depot</strong>\r\nPenta Foods Limited\r\nPenta House\r\nLynchford Lane\r\nFarnborough\r\nHants\r\nGU14 6JD\r\nTel +44 (0) 845 051 0223\r\nFax +44 (0) 845 051 0224\r\nEmail sales@pentafoods.com\r\n</div>\r\n<div style="float:right; width:50%; height:250px;"><strong>Manchester Depot</strong>\r\nPenta Foods Limited\r\nUnit 6-9\r\nBarton Business Park\r\nCawdor Street\r\nManchester\r\nGreater Manchester\r\nM30 0QR\r\n</div>\r\n\r\n<em>To register your interest please fill in all the required boxes below.</em>', '', 'full_html'),
('node', 'faq', 0, 21, 21, 'und', 0, '<p>The quality of produce, food safety and tracebility are increasingly becoming one of the pillars of our business. With increased requirements from our customers for product data and information and due diligence, we have and are currently investing more and more resources in food safety. We can offer customers: </p>\r\n<li>Accredited CMI certification.</li>\r\n<li>HIGHER LEVEL ACCREDITATION with NSF CMI for importation, storage, distribution of ambient, chilled and frozen foods and non-food items.</li>\r\n<li>Recognised supplier audits to ensure due diligence and accreditation.</li>\r\n<li>Offer product tracebility - especially important for our imported lines.</li>\r\n<li>In-house food safety consultant.</li>\r\n<li>Environmental and waste recycling systems and policies.</li>', '', 'full_html'),
('node', 'faq', 0, 22, 22, 'und', 0, '<p>We pride ourselves with stocking over 2,500 unique ambient, chilled and frozen product lines. These range from the every day well-known brands (Heinz, Kelloggs and many others) and products such as cooking oils, sauces and dry goods to exquisite fine foods from France and Europe, Latin foods from Central and South America and Far Eastern ingredients from South East Asia, China and Japan. </p>\r\n<p>We pack and supply many products under own established brands: Benito, Orient Pearl, Ethnic and Stock & Broth Co (see Brands page). Our frozen and chilled foods ranges are expanding. Frozen breads and desserts, potato fries, ice creams, cheeses and other dairy products are just some of the products supplied. </p>\r\n\r\n<p>We are one of largest importers of Thai fragrant rice, Sushi rice, noodles from China, Coconut milk and Rice sticks and paper from Thailand. All our canned tomatoes are directly imported from Italy as are most of our canned vegetable and fruits. Our inventory system can manage stock on a daily to monthly basis ensuring efficient stock management. </p>\r\n<p>Our buyers have helped us to establish our company as one of the leading and progressive foodservice businesses in the UK market. We can bring the following strengths to the partnership:</p>\r\n<ul>\r\n<li>22 years of knowledge in sourcing products globally and continue to strive forward to meet our customers changing requirements.</li>\r\n<li>With buying offices in Thailand and China, and supplier links in Europe, USA and South America, we are able to extract unparalleled local knowledge of food ingredients from various parts of the world.</li>\r\n<li>Our buying team micro-manages stock levels to ensure product availability.</li>\r\n<li>We have the buying volume many commodity and specialised lines to negotiate on price to ensure best value for our customers.</li>\r\n<li>Are able to add value to our customers brands and businesses by the products we are able to buy directly from source.</li>\r\n</ul>', '', 'full_html'),
('node', 'faq', 0, 23, 23, 'und', 0, '<p>We take pride in having a dedicated Customer Services team waiting to provide daily back up to day to day challenges and issues and give the Penta management feedback from you so that improvements can be made to our service. The Customer Service advisors are trained to deal with any issues in a prompt and professional manner. They handle the following matters during a typical business day:</p>\r\n\r\n<li>Credit queries</li>\r\n<li>Credit notes</li>\r\n<li>Price queries</li>\r\n<li>All customer complaints</li>\r\n<li>Estimated time of delivery enquiries</li>\r\n<li>Product issues</li>\r\n<li>Advising and imparting with information regarding Holiday/ Bank holiday opening and operating times</li>', '', 'full_html'),
('node', 'faq', 0, 24, 24, 'und', 0, '<p>In any successful business, the accounts department plays an integral part in customer management. Their professionalism and attention to detail is second to none. We are proud to boast that our accounts department are:</p>\r\n<li>On site, professionally trained accounts personnel assisting all customers with payments.</li>\r\n<li>Collate and send monthly statements to all customers either electronically, fax or post.</li>\r\n<li>Assisting customers to mutually agree the best payment method e.g. Bank Transfers, Cheques, Direct Debts, Cash or Credit cards).</li>\r\n<li>Assessing Individual credit applications and liasing with our field based Business Development managers and the customers.</li>\r\n<li>Helping potential new customers to apply for a credit account with Penta Foods. Assisting in completing an application form and ensuring all the required information is properly completed.\r\n (Please note - at least 5 - 7 working days are needed for credit approval. Please Attach PDF.)</li>\r\n<li>Our standard payment terms are 28 days from statement. We ask our customers to respect our payment terms and to reciprocate the service we provide by ensuring the payments due are made on time.</li>', '', 'full_html'),
('node', 'faq', 0, 25, 25, 'und', 0, '<p>All our customers have a dedicated Business Development Manager (BDM). Our BDMs are specially trained to work closely with new and existing customers. They play a pivotal role in introducing you to your dedicated Telesales Advisor and bringing together other departments in the business to meet your requirements.</p> <p>Each BDM has a portfolio of accounts which they manage with their allocated Telesales Advisor. Their area of expertise is:</p><ul><li>To find and develop new potential</li><li>Managing (with their Telesales counterparts) existing customers requirements and visiting those existing accounts on a regular basis</li><li>Being involved in finding solutions for issues that may arise from time to time</li><li>Highlighting current product promotions</li><li>Suggesting new lines to customers (either frozen Chilled or Dry) to the current mix of products supplied to them</li><li>Helping customers to consolidate their supplier base through Penta Foods, covering a larger range of the products being supplied by fewer suppliers</li><li>Managing price reviews</li><li>Organising and coordinating product specification/data as per customer requirements</li>', '', 'full_html'),
('node', 'faq', 0, 26, 26, 'und', 0, '<p>As is the case with the Business Development Managers, each customer has a dedicated Telesales adviser. When calling us, you can always ask for your dedicated advisor who will be happy to take your order or help with any other query you may have. </p>\r\n<p>The idea for the dedicated advisor is to forge a closer working relationship with their respective customer contact, have in depth knowledge of their buying history and recommend new products services.</p>\r\n<p>Each member of the dedicated Telesales team works hand-in-hand with their allocated field-based Business Development manager in managing their customer portfolio. Their main area of expertise is:</p>  \r\n<li>Capture inbound orders via the telephone, email, fax and answerphone.</li>\r\n<li>In depth knowledge of the customers buying patterns and history and delivery details.</li>\r\n<li>Upselling products through outbound calls (product promotions) as well as gap selling.</li>\r\n<li>Assisting the customers with their various queries e.g. new products and prices, liaising with other departments within the business to answer customers questions, resolving issues arising during the normal business day.</li>', '', 'full_html'),
('node', 'faq', 0, 27, 27, 'und', 0, '<p>Our aim is to provide price stability at competitive rates to our customers. Prices are reviewed every three months and should a price change, one months notice is given as standard.<p/>\r\n<p>We can negotiate special prices for different time periods which would vary from customer to customer, depending on volumes and other specific requirements.</p>', '', 'full_html'),
('node', 'faq', 0, 28, 28, 'und', 0, '<p>With 45 multi-temperature vehicles at our disposal and 24 hour transport cover, our Transport team have the expertise and resources to meet all customers delivery requirement successfully.</p>\r\n<p>We deliver:</p><p>MONDAY to FRIDAY nationally, subject to specific delivery days for customers outside London. SATURDAY deliveries are offered into London, subject to a pre-arranged agreement. Kindly speak to your Business Development manager to setup these arrangements. London customers have the option of either Day-time deliveries or Night-time deliveries depending on their specific requirements. This needs to be discussed and pre-arrranged through your Business Development manager.</p>\r\n<p>Our aim is to endeavour to deliver to our customers before lunch service, avoiding service times, where ever possible. For our national coverage, please see the delivery days and the cities we deliver to in the Transport section of this website.</p>\r\n', '', 'full_html'),
('node', 'faq', 0, 29, 29, 'und', 0, '<p>We offer various methods for receiving orders to suit our customer requirements. Note that all orders must be placed before midnight for next day delivery:</p><ul><li>Order by Telephone/Voicemail: 0845 051 0223</li><li>Orders can be placed between 9:00am and 4:30pm with your dedicated Telesales advisor. Outside these hours, the Penta answerphone service is available.</li><li> ALL orders must be placed before midnight for a next day delivery.</li><li>Email: orders@pentafoods.com</li><li>Fax: 0845 051 0224</li><li>Minimum Orders: There is no minimum order value for deliveries within the M25. Minimums do apply to orders elsewhere. Please contact Business Development Manager to discuss.</li><li>Electronic order receipt and invoicing system (EDI): We offer all customers, who run the FnB Shop (Four Hospitality) or Red Pepper (Comtrex AS2) softwares, the facility to interface with our computer system to receive orders and send invoices electronically. For further information, please contact your Business Development manager.</li><li>Additions to orders: To help us get your delivery on time we would prefer you to place your main order between 9:00am and 4:30pm. Any additional orders, can be placed on our answerphone service before the midnight order cut-off time.</li></ul>', '', 'full_html'),
('node', '2_column_page', 0, 30, 30, 'und', 0, '<p>We deliver widely across the UK. Please see the table to choose your town or region that you are located near. Having chosen your region, use the key to identify your delivery days, e.g. <strong>T F</strong> is Tuesday and Friday.  </p>\r\n<div id="map-image"><p><img alt="UK Map" class="float left" src="../sites/all/themes/penta_foods/images/map_580x820_NEW.jpg" style="width: 100%; " /></p></div>', '', 'full_html'),
('node', 'page', 0, 33, 33, 'und', 0, '<div class="col-1"><h5>COVERAGE</h5>\r\n<p>We have an extensive and versatile fleet of 45 multi-temperature/dual compartment vehicles, ranging from large 18 tonne trucks to small vans. Based in Farnborough and Manchester, they provide flexibility and total national coverage.With over 1000 deliveries per day, we offer 24 hours six days a week (7 days a week for within M25 customers) delivery option.</p></div>\r\n<div class="col-2"><h5>TRAINING</h5>\r\n<p>As proud members of FTA (Freight Transport Association) they offer us TOTAL nationwide logistics training and advice. Our Transport Management Team are trained and are holders of CPC licenses. Our drivers are regulated with ALL VOSA legislation and monitored 24hours by  our staff members. The team are fully trained in customer service, food safety and multi-temperature food handling.</p></div>\r\n<div class="col-3"><h5>TRACKING</h5>\r\n<p>A comprehensive vehicle tracking system on all vehicles allows us to monitor security and accuracy of vehicle/goods location. It also enables us to analyse driver performance/ driving styles, report back to customers with realistic delivery times. New updates to running systems also allows accurate temperature readings from within the vehicle to be recorded every 30 seconds.</p></div>\r\n<h5>Warehousing</h5>\r\n<p>Every successful distribution business must operate a fully integrated warehouse. With real-time inventory control and picking/checking performance monitoring, we are able to accurately pick and load over 1000 orders daily. All products and deliveries are fully integrated to their assigned routes to ensure maximum delivery efficiency.</p>\r\n<p>We operate from our main depot in Farnborough, Hampshire, consisting of 35,000 square foot storage for ambient, chilled and frozen products serving London and Southern England. The Manchester depot consists of 10,000 square, serves the Midlands, North England and Scotland.</p>\r\n<p>The Warehouse operates 24 hours a day six days a week processing and delivering your orders. There are sixty members of the Warehouse management and picking team fully trained in food handling, health and safety.</p>\r\n', '', 'full_html'),
('node', '2_column_page', 0, 90, 90, 'und', 0, '<p>We have an extensive and versatile fleet of 45 multi-temperature/dual compartment vehicles, ranging from large 18 ton trucks to small vans. Based in Farnborough and Manchester, they provide flexibility and total national coverage. With over 500 deliveries per day, we offer 24 hours six days a week (within M25 customers) delivery option.</p></div>\r\n<h5>Training</h5>\r\n<p>As proud members of FTA (Freight Transport Association), we have total nationwide logistics training and advice. Our Transport team is trained and holds CPC licenses. Our drivers are regulated under VOSA legislation and monitored 24 hours by our staff members. The team is fully trained in customer service, food safety and multi-temperature food handling.</p></div>\r\n<h5>Tracking</h5>\r\n<p>A comprehensive vehicle tracking system on all vehicles allows us to monitor security and accuracy of vehicle/goods location. It also enables us to analyse driver performance/ driving styles and report back to customers with realistic delivery times. In the near future, vehicles will have systems installed to record temperature readings in the chiller/freezer compartments. </p></div>', '', 'full_html'),
('node', '2_column_page', 0, 91, 91, 'und', 0, '<p>Every successful distribution business must operate a fully integrated warehouse. With real-time inventory control and picking/checking performance monitoring, we are able to accurately pick and load over 500 orders daily. </p>\r\n<p>We operate from our main depot in Farnborough, Hampshire, consisting of 35,000 square foot storage for ambient, chilled and frozen products serving London and Southern England. The Manchester depot consists of 10,000 square, serves the Midlands, North England and Scotland.</p>\r\n<p>The Farnborough warehouse operates 24 hours per day six days per week processing and delivering your orders. There are sixty members of the Warehouse team fully trained in food handling and health and safety.</p>\r\n', '', 'full_html'),
('node', 'notice_board', 0, 93, 93, 'und', 0, '<p>We are switching over to night deliveries for all orders being deliver into LONDON commencing the evening of the 22<sup>nd</sup> July 2012.</p><p>Our Order cut-off times for LONDON night deliveries will be 12pm mid-day.</p><p>For further information on order cut-off times and delivery times please contact your dedicated Account Manager or Telesales Advisor.</p><p>Alternatively you can contact our Transport Dept on (m) 0779615049 or <a href="mailto:transport@pentafoods.com">transport@pentafoods.com</a>.</p>', '', 'full_html'),
('node', 'faq', 0, 94, 94, 'und', 0, '<p>With our own presentation kitchen on site, our product development team are able to present new and fresh innovative products from our vast product range. The kitchen allows us to create a similar environment to our customers surroundings when cooking and presenting specific ingredients.</p>\r\n<p>The facility helps us to:</p>\r\n<ul>\r\n<li>Show new and existing customers the overall customer experience when using Penta Foods as a supplier.</li>\r\n<li>Create product awareness when customers are visiting our business.</li>\r\n<li>Customers can test and taste specific products that may fit their requirements.</li>\r\n<li>Existing Customers can cook and spend time with their dedicated Business Development Managers to help them plan for new menu changes.</li>\r\n<li>Enhance our strength as a business when new potential customers are considering to take us on as one of their key primary suppliers.</li>\r\n<li>Develop and add new products to our branded lines.</li>\r\n</ul>', '', 'full_html'),
('node', '2_column_page', 0, 100, 100, 'und', 0, '<p>Penta Foods Limited was established in 1987 by the Rubbani family.</p>\r\n<p>The story starts in the garage of their family home in Crowthorne, Berkshire.</p>\r\n<p>Since then the company has grown year on year moving four times during this period. From its early years, the business relocated from Crowthorne, Berkshire to Camberley in Surrey and then to its present location in Farnborough, Hampshire.</p>\r\n<p>In 1995, the family members setup a buying office in Bangkok, Thailand. Seeing a gap in the market for fusion style foods, the Bangkok office helped the business to source, consolidate products and orders ready to be shipped to the UK. Over the years, other associations were established in China, Europe, the USA and South America to help with sourcing and shipping products.</p>\r\n<p>January 2007 saw the birth of the companys Manchester depot, in Eccles. This allowed the business to have national coverage giving greater flexibility to its customer base.</p>\r\n<p>Each milestone saw incredible growth for the business and has now become one the leading foodservice companies in London and beyond.</p>\r\n<p>In November 2010, the management team acquired and integrated Unifoods Limited, a London based foodservice company. This bold move helped Penta Foods to establish itself in the Five Star hotel trade in London.</p>\r\n<p>The business is still run by five family members and looks forward to the next generation to carry on the Company values and its growth.</p>', '', 'full_html'),
('node', 'page', 0, 101, 101, 'und', 0, '<p>&nbsp;</p><div style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; vertical-align: baseline; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: rgb(255, 255, 255); font: normal normal normal 81.3%/1.538em ''Lucida Grande'', ''Lucida Sans Unicode'', sans-serif; font-family: Times; line-height: normal; font-size: medium; "><p style="margin-top: 1em; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; vertical-align: baseline; ">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent et arcu non arcu dapibus sodales. Aliquam erat volutpat. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Maecenas commodo dictum diam vitae porta. Vestibulum a tellus quis eros placerat porttitor. Curabitur urna leo, aliquam et dictum quis, iaculis id ante. Nam in orci sem. Nulla facilisi. Aenean feugiat mollis tincidunt. Duis bibendum tincidunt tortor sit amet rhoncus. In ultricies venenatis nisl, eu faucibus tellus consectetur non. Cras congue nibh hendrerit nisl scelerisque pharetra. Vestibulum aliquam purus vulputate dui interdum vel facilisis purus vulputate. Donec ultrices justo in quam pellentesque ac viverra lorem posuere. Curabitur ut eros lorem, eget accumsan purus. Nullam sit amet purus a erat semper volutpat sed ac justo. Suspendisse gravida, purus a tincidunt faucibus, ipsum lorem eleifend libero, sed euismod nisi ipsum vel ante. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae;</p></div><p>&nbsp;</p>', '', 'filtered_html'),
('node', 'page', 0, 102, 102, 'und', 0, '<p>For more information during the Olympic period, please click here for up-to-date information regarding affected roads in your area.\r\nwww.getaheadofthegames.com</p>\r\n<p>From Monday 13th August, we will be reverting back to normal day deliveries. This will be for not only the period between the Olympics and Paralympic but also for the duration of the Paralympic.</p>\r\n<p>However, certain post codes that will be reverting back to night deliveries during the Paralympics period. </p> \r\n<p>The following post code will be reverting back to night deliveries at the start of the Paralympics: </p>\r\n<p>E15, E20 </p>\r\n<p>If you are still unsure please contact your dedicated Account Manager or Telesales Advisor. Alternatively, you can contact our transport department on (m) 07790615050 or email them on transport@pentafoods.com and they will be happy to assist you.</p>', '', 'full_html');
