(8, 'node', ' standard terms conditions click here to download our terms and conditions 1 definitions and interpretations 11 in these conditions these words and expressions shall except where the context otherwise requires have the following meanings buyer the person who accepts a quotation of the seller for the sale of the goods or whose order for the goods is accepted by the seller conditions the standard terms of sale set out in this document and unless the context otherwise requires includes any special terms agreed in writing between the buyer and the seller contract the contract for the purchase and sale of the goods goods the goods including any installments of the goods or any parts of them which the seller is to supply in accordance with these conditions seller penta foods ltd registered in england under number 2628701 12 references in these conditions to clauses subclauses and schedules are to clauses subclauses and schedules of these conditions 13 where reference is made in these conditions to a statutory provision this includes all prior and subsequent enactments amendments and modifications in relation to that provision and any regulations made under it 14 in these conditions words in the singular shall include the plural and vice versa and words importing the masculine feminine and neuter gender shall include the others 15 references to a person shall include any individual partnership unincorporated association or body corporate 16 clause headings are for convenience only and do not affect the interpretation or construction of these conditions 2 terms of sale 21 the parties contract on the terms contained in these conditions which shall prevail over any inconsistent terms which the buyer may seek to introduce such inconsistent terms shall have no effect 22 these conditions form the whole agreement between the seller and the buyer and shall not be removed or varied in any way no other express terms written or oral shall be incorporated into the contract unless expressly agreed by authorized persons from both parties in writing 23 the seller s sales representatives are not authorized to do any of the following things on behalf of the seller 231 remove or vary any of these terms or introduce any other terms written or oral into the contract 232 make any representation agree any condition precedent or enter into any collateral contract 233 accept any offer or counteroffer made by the buyer 3 orders and specifications 31 the description of the goods shall be as set out in the seller s quotation 32 the seller may from time to time make alterations in the specification of goods which are required to comply with any applicable statutory requirements of which do not materially affect the fitness for purpose or quality of the goods 4 cancellation 41 the buyer is not permitted to cancel this contract except with the written consent of the seller 42 where there is an agreed cancellation permitted by paragraph 41 above the buyer shall pay to the seller the sum of 10 per cent of the contract price representing liquidated damages to compensate the seller for all losses incurred as a result of the cancellation 5 price of the goods 51 this is the seller s quoted contract price of the goods 52 if no price has been quoted it is the price given for the goods in the seller s standard price list effective at the date the order is accepted 53 unless otherwise stated prices in any quotation or given in the seller s price list effective at the date the order is accepted 54 if the seller incurs any costs including storage charges as a result of the buyer s neglect or default the buyer must pay those costs in addition to the quoted contract price 55 where at any time before delivery of the goods 551 there is an increase in the cost of a raw materials or b labour or services or 552 there are any currency fluctuations increasing the cost of raw materials the seller may adjust the price accordingly 56 unless otherwise stated all prices quoted or given in the seller s price list are exclusive of vat 6 payment 61 the seller is entitled to send an invoice to the buyer for the price of the goods on or at any time after the delivery of the goods 62 the buyer must pay the invoice value as per the terms determined by the seller from the buyer s credit rating and account application starting from the date of the seller s invoice 63 the seller reserves the right to charge interest at 10 per cent per annum on all overdue accounts interest is deemed to accrue on a daytoday basis from and including the date for payment under clause 62 64 if the buyer fails to pay any installment of the price on the date it becomes payable the whole of the balance of the price then outstanding becomes payable immediately 65 if the buyer fails to pay the price on the date specified the seller may terminate the contract and recover the goods in accordance with clause 8 7 delivery 71 all items which the seller is to deliver will be delivered to the buyer s address if known in the absence of such address delivery is deemed to take place at the seller s premises 72 the seller reserves the right to make delivery by installments and to tender a separate invoice in respect of each installment each delivery shall constitute a separate contract 73 if the seller delivers one or more installments late or delivers one or more installments which do not correspond with the terms of the contract the buyer may not treat this as a reason for terminating the contract as a whole the buyer s remedy is limited to a claim for damages 74 delivery dates mentioned in any quotation order or other document are approximate only and not of any contractual effect the seller shall not be liable for any delay in delivery howsoever caused 75 late delivery of the goods does not entitle the buyer to do any of the following 751 reject the goods 752 terminate the contract 753 withhold payment of any part of the contract price 76 the seller reserves the right to deliver up to 10 per cent less than the quantity ordered 8 property and risk 81 ownership of the goods remains with the seller and will not pass to the buyer until one of the following events occurs 811 the seller has paid for all of the goods and no other amounts are owed by the buyer to the seller in respect of other goods supplied by the seller 812 the buyer sells the goods in accordance with these conditions in which case ownership of the goods will pass to the buyer immediately before the goods are delivered to the buyer s customer 82 where the goods are attached to or incorporated in other goods or are altered by the buyer ownership of the goods shall not pass to the buyer by virtue of the attachment incorporation or alteration if the goods remain identifiable and where attached to or incorporated in other goods can be detached or removed from them 83 the buyer must store the goods separately from any other goods until one of the following events occurs 831 they become the buyer s property or 832 they are attached to or incorporated in other goods or 833 they are delivered to a purchaser from the buyer 84 if the buyer is overdue in paying for the goods or any other goods supplied by the seller the seller may if still the owner of the goods recover and resell them the seller may enter the buyer s premises for this purpose and may if necessary detach or remove the goods from any other goods this does not affect any other right of the seller 85 until the buyer has paid the seller for the goods and all other goods which the seller has supplied to the buyer 851 the buyer must not assign to any other person any rights arising from a sale of the goods without the seller s written consent 86 risk in the goods passes to the buyer on delivery in accordance with clause 7 87 the buyer must have valid insurance at the date of purchase to cover the goods against all insurable risks for the price due to the seller for the goods 88 if the goods are destroyed by an insured risk before the buyer has paid for them the buyer shall hold the insurance proceeds as the seller s trustee 9 warranties and liability 91 subject to the conditions set out below the seller warrants that the goods will correspond with their specification at the time of delivery and will be free from defects 92 the buyer shall carefully examine the goods immediately on delivery of them and shall notify the seller in writing of any defects reasonably discoverable on careful examination the seller must receive this notification within 7 days commencing with the day of delivery to the buyer in the absence of notification the seller excludes all liability in respect of any defect because the potential losses which the buyer may suffer as a result of any breach of contract by the seller are more readily ascertainable by the buyer and because any such losses could be disproportionate to the contract price and so that the seller can keep the contract price as low as possible the parties agree that the seller limits its liability as follows 93 where any valid claim in respect of any of the goods which is based on any defect in the quality or condition of the goods or their failure to meet specification is notified to the seller in accordance with these conditions the seller shall be entitled to replace the goods or the part in question free of charge or at the seller s sole discretion refund to the buyer the price of the goods or the proportionate part of the price but the seller shall have no further liability to the buyer 94 the seller shall not be liable for any consequential or indirect loss suffered by the buyer whether this loss arises from breach of duty in contract or tort or in any other way including loss arising from the seller s negligence nonexhaustive illustrations of consequential or indirect loss would be loss of profits loss of contracts damage to property of the buyer or anyone else and personal injury to the buyer or anyone else but only so far as such injury is not caused by the seller s negligence 95 the seller shall not be liable for any failure to deliver the goods arising from circumstances outside the seller s control 951 nonexhaustive illustrations of circumstances outside the seller s control include act of god war riots explosion abnormal weather conditions fire flood government action strikes lockouts delay by suppliers accidents and shortage of materials labour or manufacturing facilities 952 if the seller is prevented from delivering in the above circumstances it shall notify the buyer of the fact 953 if the circumstances preventing delivery continue redelivery will be arranged by the seller at a time such that the circumstances preventing delivery change 954 if the contract is cancelled in this way the seller shall refund any payment which the buyer has already made on account of the price subject to deduction of any amount which the seller is entitled to claim from the buyer but the seller accepts no liability to compensate the buyer for any further loss or damage caused by the failure to deliver 10 insolvency if the buyer 101 being a company 1011 has a petition presented for its winding up or 1012 passes a resolution for voluntary windingup other than for the purpose of a bona fide amalgamation or reconstruction or 1013 enters into a voluntary arrangement with its creditors or 1014 becomes subject to an administration order or 1015 has a receiver appointed of all or any of its assets or 102 being an individual or firm 1021 becomes bankrupt or insolvent or 1021 enters into a voluntary arrangement with creditors then the seller shall be entitled to treat the contract as being at an end or suspend any further deliveries under the contract if the goods have been delivered but not paid for the price shall become due immediately regardless of any previous agreement to the contrary general 111 the seller is not a member of any group of companies and accordingly the seller does not act on behalf of any group of companies