(16, 'node', ' about us we have been established for over 25 years delivering exquisite food ingredients to chefs in london and around the uk whether you run a single restaurant or hotel in london or a large established chain or are in the foodservice industry we have the global product range sourcing reach and delivery resources to meet your requirements being a family business our ethos and promise to you is total commitment to serve your foodservice requirements an unrivalled product range flexible delivery solutions to promptly and clearly communicate with you extensive resources available to us and with our personal approach resulting in a fulfilling customer experience  ', 0),
