(20, 'node', ' contact us head office farnborough depot penta foods limited penta house lynchford lane farnborough hants gu14 6jd tel 44  845 51 223 fax 44  845 51 224 email sales pentafoodscom manchester depot penta foods limited unit 69 barton business park cawdor street manchester greater manchester m30 0qr to register your interest please fill in all the required boxes below name company name email address comments  ', 0),
(21, 'node', ' food safety quality the quality of produce food safety and tracebility are increasingly becoming one of the pillars of our business with increased requirements from our customers for product data and information and due diligence we have and are currently investing more and more resources in food safety we can offer customers accredited cmi certification higher level accreditation with nsf cmi for importation storage distribution of ambient chilled and frozen foods and nonfood items recognised supplier audits to ensure due diligence and accreditation offer product tracebility especially important for our imported lines inhouse food safety consultant environmental and waste recycling systems and policies  ', 0),
(22, 'node', ' sourcing products buying team we pride ourselves with stocking over 2500 unique ambient chilled and frozen product lines these range from the every day wellknown brands heinz kelloggs and many others and products such as cooking oils sauces and dry goods to exquisite fine foods from france and europe latin foods from central and south america and far eastern ingredients from south east asia china and japan we pack and supply many products under own established brands benito orient pearl ethnic and stock broth co see brands page our frozen and chilled foods ranges are expanding frozen breads and desserts potato fries ice creams cheeses and other dairy products are just some of the products supplied we are one of largest importers of thai fragrant rice sushi rice noodles from china coconut milk and rice sticks and paper from thailand all our canned tomatoes are directly imported from italy as are most of our canned vegetable and fruits our inventory system can manage stock on a daily to monthly basis ensuring efficient stock management our buyers have helped us to establish our company as one of the leading and progressive foodservice businesses in the uk market we can bring the following strengths to the partnership 22 years of knowledge in sourcing products globally and continue to strive forward to meet our customers changing requirements with buying offices in thailand and china and supplier links in europe usa and south america we are able to extract unparalleled local knowledge of food ingredients from various parts of the world our buying team micromanages stock levels to ensure product availability we have the buying volume many commodity and specialised lines to negotiate on price to ensure best value for our customers are able to add value to our customer s brands and businesses by the products we are able to buy directly from source  ', 0),
(23, 'node', ' customer service we take pride in having a dedicated customer services team waiting to provide daily back up to day to day challenges and issues and give the penta management feedback from you so that improvements can be made to our service the customer service advisors are trained to deal with any issues in a prompt and professional manner they handle the following matters during a typical business day credit queries credit notes price queries all customer complaints estimated time of delivery enquiries product issues advising and imparting with information regarding holiday bank holiday opening and operating times  ', 0),
(24, 'node', ' accounts opening an account with penta foods limited in any successful business the accounts department plays an integral part in customer management their professionalism and attention to detail is second to none we are proud to boast that our accounts department are on site professionally trained accounts personnel assisting all customers with payments collate and send monthly statements to all customers either electronically fax or post assisting customers to mutually agree the best payment method eg bank transfers cheques direct debts cash or credit cards assessing individual credit applications and liasing with our field based business development managers and the customers helping potential new customers to apply for a credit account with penta foods assisting in completing an application form and ensuring all the required information is properly completed please note at least 5 7 working days are needed for credit approval please attach pdf our standard payment terms are 28 days from statement we ask our customers to respect our payment terms and to reciprocate the service we provide by ensuring the payments due are made on time  ', 0),
(25, 'node', ' business development managers bdm  all our customers have a dedicated business development manager bdm our bdms are specially trained to work closely with new and existing customers they play a pivotal role in introducing you to your dedicated telesales advisor and bringing together other departments in the business to meet your requirements each bdm has a portfolio of accounts which they manage with their allocated telesales advisor their area of expertise is to find and develop new potential managing with their telesales counterparts existing customers requirements and visiting those existing accounts on a regular basis being involved in finding solutions for issues that may arise from time to time highlighting current product promotions suggesting new lines to customers either frozen chilled or dry to the current mix of products supplied to them helping customers to consolidate their supplier base through penta foods covering a larger range of the products being supplied by fewer suppliers managing price reviews organising and coordinating product specification data as per customer requirements  ', 0),
(26, 'node', ' telesales advisors as is the case with the business development managers each customer has a dedicated telesales adviser when calling us you can always ask for your dedicated advisor who will be happy to take your order or help with any other query you may have the idea for the dedicated advisor is to forge a closer working relationship with their respective customer contact have in depth knowledge of their buying history and recommend new products services each member of the dedicated telesales team works handinhand with their allocated fieldbased business development manager in managing their customer portfolio their main area of expertise is capture inbound orders via the telephone email fax and answerphone in depth knowledge of the customers buying patterns and history and delivery details upselling products through outbound calls product promotions as well as gap selling assisting the customers with their various queries eg new products and prices liaising with other departments within the business to answer customers questions resolving issues arising during the normal business day  ', 0),
(27, 'node', ' pricing policy our aim is to provide price stability at competitive rates to our customers prices are reviewed every three months and should a price change one months notice is given as standard we can negotiate special prices for different time periods which would vary from customer to customer depending on volumes and other specific requirements  ', 0),
(28, 'node', ' deliveries with 45 multitemperature vehicles at our disposal and 24 hour transport cover our transport team have the expertise and resources to meet all customers delivery requirement successfully we deliver monday to friday nationally subject to specific delivery days for customers outside london saturday deliveries are offered into london subject to a prearranged agreement kindly speak to your business development manager to setup these arrangements london customers have the option of either daytime deliveries or nighttime deliveries depending on their specific requirements this needs to be discussed and prearrranged through your business development manager our aim is to endeavour to deliver to our customers before lunch service avoiding service times where ever possible for our national coverage please see the delivery days and the cities we deliver to in the transport section of this website  ', 0),
(29, 'node', ' placing orders we offer various methods for receiving orders to suit our customer requirements note that all orders must be placed before midnight for next day delivery order by telephone voicemail 845 51 223 orders can be placed between 900am and 430pm with your dedicated telesales advisor outside these hours the penta answerphone service is available all orders must be placed before midnight for a next day delivery email  orders pentafoodscom fax 845 51 224 minimum orders there is no minimum order value for deliveries within the m25 minimums do apply to orders elsewhere please contact business development manager to discuss electronic order receipt and invoicing system edi we offer all customers who run the fnb shop four hospitality or red pepper comtrex as2 softwares the facility to interface with our computer system to receive orders and send invoices electronically for further information please contact your business development manager additions to orders to help us get your delivery on time we would prefer you to place your main order between 900am and 430pm any additional orders can be placed on our answerphone service before the midnight order cutoff time  ', 0),
(30, 'node', ' our coverage we deliver widely across the uk please see the table to choose your town or region that you are located near having chosen your region use the key to identify your delivery days eg t f is tuesday and friday  ', 0),
(33, 'node', ' logistics transport and warehousing coverage we have an extensive and versatile fleet of 45 multitemperature dual compartment vehicles ranging from large 18 tonne trucks to small vans based in farnborough and manchester they provide flexibility and total national coverage with over 1000 deliveries per day we offer 24 hours six days a week 7 days a week for within m25 customers delivery option training as proud members of fta freight transport association they offer us total nationwide logistics training and advice our transport management team are trained and are holders of cpc licenses our drivers are regulated with all vosa legislation and monitored 24hours by our staff members the team are fully trained in customer service food safety and multitemperature food handling tracking a comprehensive vehicle tracking system on all vehicles allows us to monitor security and accuracy of vehicle goods location it also enables us to analyse driver performance driving styles report back to customers with realistic delivery times new updates to running systems also allows accurate temperature readings from within the vehicle to be recorded every 30 seconds warehousing every successful distribution business must operate a fully integrated warehouse with realtime inventory control and picking checking performance monitoring we are able to accurately pick and load over 1000 orders daily all products and deliveries are fully integrated to their assigned routes to ensure maximum delivery efficiency we operate from our main depot in farnborough hampshire consisting of 35000 square foot storage for ambient chilled and frozen products serving london and southern england the manchester depot consists of 10000 square serves the midlands north england and scotland the warehouse operates 24 hours a day six days a week processing and delivering your orders there are sixty members of the warehouse management and picking team fully trained in food handling health and safety  ', 0),
