(90, 'node', ' our fleet we have an extensive and versatile fleet of 45 multitemperature dual compartment vehicles ranging from large 18 ton trucks to small vans based in farnborough and manchester they provide flexibility and total national coverage with over 500 deliveries per day we offer 24 hours six days a week within m25 customers delivery option training as proud members of fta freight transport association we have total nationwide logistics training and advice our transport team is trained and holds cpc licenses our drivers are regulated under vosa legislation and monitored 24 hours by our staff members the team is fully trained in customer service food safety and multitemperature food handling tracking a comprehensive vehicle tracking system on all vehicles allows us to monitor security and accuracy of vehicle goods location it also enables us to analyse driver performance driving styles and report back to customers with realistic delivery times in the near future vehicles will have systems installed to record temperature readings in the chiller freezer compartments  ', 0),
