(93, 'node', ' our olympic delivery timetable we are switching over to night deliveries for all orders being deliver into london commencing the evening of the 22 nd july 2012 our order cutoff times for london night deliveries will be 12pm midday for further information on order cutoff times and delivery times please contact your dedicated account manager or telesales advisor alternatively you can contact our transport dept on m 779615049 or transport pentafoodscom   ', 0),
(94, 'node', ' presentation kitchen with our own presentation kitchen on site our product development team are able to present new and fresh innovative products from our vast product range the kitchen allows us to create a similar environment to our customers surroundings when cooking and presenting specific ingredients the facility helps us to show new and existing customers the overall customer experience when using penta foods as a supplier create product awareness when customers are visiting our business customers can test and taste specific products that may fit their requirements existing customers can cook and spend time with their dedicated business development managers to help them plan for new menu changes enhance our strength as a business when new potential customers are considering to take us on as one of their key primary suppliers develop and add new products to our branded lines  ', 0),
