(100, 'node', ' our history penta foods limited was established in 1987 by the rubbani family the story starts in the garage of their family home in crowthorne berkshire since then the company has grown year on year moving four times during this period from its early years the business relocated from crowthorne berkshire to camberley in surrey and then to its present location in farnborough hampshire in 1995 the family members setup a buying office in bangkok thailand seeing a gap in the market for fusion style foods the bangkok office helped the business to source consolidate products and orders ready to be shipped to the uk over the years other associations were established in china europe the usa and south america to help with sourcing and shipping products january 2007 saw the birth of the company s manchester depot in eccles this allowed the business to have national coverage giving greater flexibility to its customer base each milestone saw incredible growth for the business and has now become one the leading foodservice companies in london and beyond in november 2010 the management team acquired and integrated unifoods limited a london based foodservice company this bold move helped penta foods to establish itself in the five star hotel trade in london the business is still run by five family members and looks forward to the next generation to carry on the company values and its growth  ', 0),
