(20, 35, 4, '0', 'astraysky@gmail.com'),
(20, 35, 5, '0', '\r\nGood morning, my name is Jerry Wang from Ming Chyi Biotechnology Ltd., (MCB) in Taiwan. \r\n \r\nFirst of all, I apologize if I am using my personal email address to reply you. Our server is currently down and will be recovered soon. \r\n \r\nPlease allow me to shortly introduce our company to you. Ming Chyi Biotechnology Ltd (MCB) is a Taiwanese Spray Drying Biotechnology company. \r\n \r\nMCB manufactured in many different food powder products, which can be applied in various applications, such as: Food Additive, Food Ingredients, Health Products, Nutritional Supplements, Raw Materials and many more. We also have more than 20 years of experience in providing our best OEM / ODM / Private Label services, in order to help our clients to expand new markets or new products. \r\n \r\nWith our strong background in spray drying, MCB has become one of the most dependable companies throughout Taiwan, supplying many local and international world-famous Food / Biotech / Ingredients / Pharmaceutical companies, with ISO 22000, ISO 14001, HACCP and HALAL certificates. \r\n \r\nThese are the products, which you may find them interested \r\n1. Soymilk Powder\r\n2. Oat Soymilk Powder\r\n3. GojiBerry Tea Powder - with Red Jujube (Dates) Powder\r\n4. Collagen Peptide Powder - fish skin \r\n5. Omega-3 Powder - Flaxseed Oil\r\n6. Plant Oil Powder - made from a mix of Canola and coconut oil\r\n7. Soybean Oil Powder 50% - fat content 50%\r\n8. Soybean Oil Powder 80% - High fat (80%) and low carbohydrate & low GI\r\n9. Lemon Juice Powder\r\n10. Plum Juice Powder\r\n11. Noni Extract Powder\r\n12. Soy Sauce Powder\r\n13. Chicken Broth Concentrate Powder\r\n \r\nWe would like to provide further product information with a catalog if you need. \r\n \r\nPlease feel free to visit our website:  www.drying.com.tw/en.  \r\n \r\nShould you require any help, please do not hesitate to contact us.\r\n \r\nBest regards,\r\n\r\n\r\n\r\n'),
