(20, 132, 4, '0', 'info@medicinalplantsseeds.co.uk'),
(20, 132, 5, '0', 'Dear Vijay,\r\n\r\n\r\n\r\nWe are a UK-based company, NIKA VG UK ltd, offering herbal teas/herbal infusion packs in bulk directly from the manufacturer at very competitive price, from as little as 0,45 per pack; for example, our Mint tea costs only 0,48.\r\n\r\n \r\n\r\nOur range includes 81 varieties:\r\n\r\n \r\n\r\n              73 different herbal teas/infusion and\r\n\r\n              8 Phyto Baths - 3 for adults and 5 for children.\r\n\r\n \r\n\r\nWe feature popular choices such as Peppermint tea and Chamomile tea, as well as select formulations, including Stop Smoking, Male Power (enhancement of male sexual stamina), Anti Heartburn, Senna and Melissa.  \r\n\r\n \r\n\r\nOur exclusive Phyto Baths comprise 3 preparations for adult''s wellbeing: Clear Skin  for the overall improvement of skin condition, For feet to reduce perspiration and unpleasant foot odour, and Healthy skin for the relief of eczema. A further 5 preparations are available for children, to help alleviate nappy rash, for example, with Bur-marigold or Bur-marigold and Chamomile.\r\n\r\n \r\n\r\nOur own proven experience in Eastern Europe in particular indicates that herbal bathing infusions form a very important part of children''s health therapy in the home throughout this region. Thus far, Eastern Europeans resident in the UK have been unable to source these products in this country, but current consumer demand has led to the manufacturer releasing this range of Phyto Baths into the UK market, offering substantial commercial growth potential.\r\n\r\n \r\n\r\nAll our products have been certified according to the requirements of Quality Certificate ISO 22000:2005 and Quality Certificate ISO 9001:2000, have been awarded the Ukrainian Public Mark of Quality "High Grade", as well as awarded 23 national certifications, and the European Quality Award from European Business Assembly, Oxford.\r\n\r\n \r\n\r\n \r\n\r\nFor more information, please go to our website: http://www.medicinalplantsseeds.co.uk\r\n\r\n \r\n\r\nPlease find attached price list.\r\n\r\n\r\n\r\nI would be happy to arrange meeting and provide some samples of our products.\r\n\r\n \r\n\r\nPlease, provide us feedback with your decision. \r\n\r\n \r\n\r\n \r\n\r\nYours faithfully,\r\n\r\n \r\n\r\n \r\n\r\nVolodymyr Gryshko\r\n\r\n \r\n\r\nDirector\r\n\r\n \r\n\r\n"NIKA VG UK Ltd"\r\n\r\n \r\n\r\nRegistration number in England and Wales: 08250866\r\n\r\nwebsite: http://www.medicinalplantsseeds.co.uk\r\n\r\nemail:     info@medicinalplantsseeds.co.uk                                                                                            \r\n\r\ntel.          +44 7827 660 927 '),
